  false,\n\t\"url\": null,\n\t\"notes\": \"This Public Schools feature dataset is
  composed of all Public elementary and secondary education in the United States as
  defined by the Common Core of Data, National Center for Education Statistics, US
  Department of Education. This includes all Kindergarten through 12th grade schools
  as tracked by the Common Core of Data. Included in this dataset are the military
  schools abroad and referenced in the city field with an APO or FPO address. Also
  referenced in the state field with the abbreviation AE. Please note that the APO
  and FPO schoolpoints are located at 0,0. This feature class contains all MEDS/MEDS+
  as approved by NGA. For each field the 'Not Avaliable' and 'NULL' designations are
  used to indicate that the data for the particular record and field is currently
  unavaliable and will be populated when and if that data becomes avaliable.\",\n\t\"license_title\":
